import React, {useState} from "react";
import SubjectCard from "./SubjectCard";
import ec_data from "./data/EC"



const Resources = ()=>{


  function NameList(props) {
const myLists = props.myLists;
const listItems = myLists.map((myList) =>
<li>{myList}</li>
);
return (
<div>
    <ul></ul>
    <a href="/dummy_book.txt" download>
      <div className="my-4 flex justify-between bg-white shadow h-10 items-centerp p-2">
      <p>{listItems}</p>
      <div>
        <svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6" fill="none" viewBox="0 0 24 24" stroke="currentColor">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4 16v1a3 3 0 003 3h10a3 3 0 003-3v-1m-4-4l-4 4m0 0l-4-4m4 4V4" />
        </svg>
      </div>
      </div>
    </a>
</div>
);
}
const myLists = ['A', 'B', 'C', 'D', 'D'];


  return(
    <div className="flex flex-wrap relative">
 {/*  <SubjectCard subName="AC" />
      <SubjectCard subName="CE" />
      <SubjectCard subName="MI" />
      <SubjectCard subName="WA" />
      <SubjectCard subName="ES" />
      <SubjectCard subName="ESD" />
      <SubjectCard subName="CAO" />
      <SubjectCard subName="CMOS" />
      <SubjectCard subName="ALGO" />  */}


      <div className="h-auto w-96 absolute top-0 left-0 shadow-lg border-2">
        <div className="p-4">
          <div className="flex justify-between">
            <div>
              <button className="p-2 m-2 shadow bg-blue-500 text-white">Books</button>
              <button className="p-2 m-2 shadow bg-white">Notes</button>
              <button className="p-2 m-2 shadow bg-white">YT Channel</button>
            </div>
            <div className="p-2 m-2 cursor-pointer">
              <svg xmlns="http://www.w3.org/2000/svg" className="h-5 w-5" viewBox="0 0 20 20" fill="currentColor">
                <path fillRule="evenodd" d="M4.293 4.293a1 1 0 011.414 0L10 8.586l4.293-4.293a1 1 0 111.414 1.414L11.414 10l4.293 4.293a1 1 0 01-1.414 1.414L10 11.414l-4.293 4.293a1 1 0 01-1.414-1.414L8.586 10 4.293 5.707a1 1 0 010-1.414z" clipRule="evenodd" />
              </svg>
            </div>
          </div>
          <div className="p-2">

<NameList myLists={myLists} />
          </div>
        </div>
      </div>


    </div>
  );
}

export default Resources;
